                        <html><head><meta charset="utf-8"></head><body>
<p>Лакомство для собак GreenQZin "БросКость" изготовлено из костной муки высшего сорта, с добавлением минерализованного кальция в сочетании с первоклассным куриным мясом.</p>
<p>Не содержит консервантов, красителей, гормонов и антибиотиков. Не вызывает аллергий. Основная польза данного лакомства в обеспечении организма собаки большим количеством легкоусвояемого белка и такого важного микроэлемента как кальций - структурной основы костной ткани. Этот элемент является самым необходимым минеральным веществом с самого рождения и до глубокой старости. Основным депо кальция в организме являются зубы и кости.</p>
<p>Кальций участвует в важнейших биохимических реакциях, и при его нехватке происходит сбой обменных процессов. Достаточное его количество напротив значительно снижает риск заболеваний, таких как сахарный диабет и рак толстой кишки. Особенно необходим кальций для щенков, когда происходит формирование скелета. Кальций также является незаменимым компонентом и для функционирования сердечно-сосудистой и мочевыделительной систем.</p>
</body></html>

